        "Desc": "生活在海渊之下的龙蜥。\n它们曾经是海渊之下的支配种族——其实在更加久远的过去，龙们就是这个世界的支配者。曾经的七王被高天之力打败，相继凋零了。\n如今似乎有龙蜥出现在了远离海渊的地方。或许它们无法融入人所主宰的世界，但这仍然是它们的世界。",
