        "Title": [
            "珊瑚的守护者"
        ],
        "Desc": "生活在海渊之下的龙蜥。因为社会分工，而出现了雷元素的形态。\n古七王凋零之后，新一代的七王正在陆续诞生。只是深海龙蜥如此进化，失去了纯粹。水之龙已经不会在它们族群中诞生了。根据预言，新的水之龙一定会以人形降临…\n如今回归完全形态的水之龙虽仍把它们视作同族，但是却与另一种族走得更近。或许是因为选择了与人携手并进，「眷属」自然是能与人相容为好；又或许是因为看到了她们的潜力。",
