        "Tutorial": "- 初始，<b>头部下方的千年珍珠含有<color style='color:#7030A0;'>19U雷元素</color></b>：千年珍珠存在期间，本体全部抗性提升60%（深渊版本80%）并释放极为危险的攻击，产生造成大量持续伤害的溢雷地板。<br>- 千年珍珠的元素量降低至7U之后，千年珍珠骏麟将会导引「原海古雷」，呼来三枚雷殛的珊瑚珠。珊瑚珠含有0.4U雷元素。每破除一枚珊瑚珠，千年珍珠都会<b>流失三分之一总含量</b>。<br>- 在15s的役雷时间内，原海古雷将持续涤荡大地。若未能破除全部的珊瑚珠，每个存活的珊瑚珠都将为千年珍珠将<b>恢复三分之一总含量+2U</b>。<br>- 摧毁千年珍珠后，会在30s（深渊版本20s）后再次生成千年珍珠。重生的千年珍珠元素量<b>降低至11.4U</b>。",
