        "Title": [
            "悠古的群山之主"
        ],
        "Desc": "优雅而高傲的灵兽，只栖息于仙力萦绕的深山中。\n自古以来，这种仙兽便被认为是福运的象征，其隐居山林、远离世俗纷扰的特质也为历代文人墨客所赞赏。在沉玉谷当地的古老传说中，猊兽的首领名为「山主」，其地位往往被认为与仙人等同。\n另有说法认为，如今伏行山林的玄文兽亦是这些仙兽的后嗣，只是因仙缘浅薄，难以继承如此高贵的血脉，从而退化为凶暴的野兽。这种说法与另一种关于玄文兽起源的说法相违背，但尽管如此，关于猊兽为数不多的记载中，其出现往往伴随着大量的玄文兽作为随从。\n如今，沉玉谷家喻户晓的「舞兽戏」，便是模仿传说中猊兽的动作与神态进行的表演。然而，真正见到过猊兽的人少之又少，绝大多数人只能通过想象来描述这种生灵的模样。数千年的流变与艺术加工后，「兽首」最终也固定成了现今的样式。",
