        "Desc": "栖息在山林之间的猛兽，是森林中的王者。\n将丛林视为自己的领地，平时会像国王一样巡视自己的疆域。如果遇到入侵者，它们会毫不留情的发起进攻。\n鬓角上长着夸张的绒毛，根据学者的研究，似乎有着测量距离的功能。\n传说在丛林中曾经有一匹真正的「虎」，是保卫丛林的灵兽。在它死后，这种形态与猫更加接近的猛兽继承了「虎」的威名。",
