        "Desc": "愚人众执行官第八席的「女士」。\n与行使邪眼之权能的其他愚人众不同，邪眼是抑制啃噬一切的烈火的器物。比起厮杀用的兵器，说是刑拘道具才更为贴切。\n而这就是漫长的岁月中积郁的余烬，冲破邪眼霜封后为她涂抹的扭曲妆容。\n\n瞳仁中倒映着破晓的赤红，她最后展开烈焰之翼向黎明飞去。\n<i>「但那并不是曙光，亲爱的罗莎琳。那是焚尽一切的火海。」</i>\n在光芒中，一个声音这么对她说。\n\n但这也没什么所谓。因为她心中明白，自己早已被烈火吞没。",
