        "Desc": "代行雷电将军权能的人偶，在对抗威胁「永恒」之敌时展现出的形态。\n作为雷电影践行「永恒」的协助者，她从未质疑，亦无畏惧，一直以来全力以赴，心无杂念。\n她曾听闻在真与影的时代，影承担着与她类似的责任，经历了诸多惨痛失去。\n当两个影子交叠为一时，她却只能看见在「她」本应永恒的意志上留下的无数细密的凿痕吧。既然命运注定是一场轮回，就如约定那样，向其宣战吧。\n\n<i>「此身，象征无上威严，被授予统领一国之权，凝聚了『雷电将军』的一切。</i>\n<i>「自然也继承了影前行时不断失去的痛苦，以及，想要抵达永恒的决心。</i>\n<i>「决心、勇气、爱慕、仇恨…都会在时间长河中变质扭曲。</i>\n<i>「唯有『法则』永恒不变。」</i>",
